import React from 'react';
import Logo from '../../Logo/Logo';
import classes from './MenuButton.module.css'


const MenuButton = (props) => (
    <div className={classes.MenuButton}>
        <div>
            <Logo />
        </div>
        <p>MENU</p>
    </div>
);

export default MenuButton;
